//import React, { useState } from 'react';
import { Nav, Container, Navbar } from 'react-bootstrap';
import Hamburger from 'hamburger-react';
import '../App.css';
import '../css/Header.css';
import React, { useReducer } from 'react';

const navReducer = (state, action) => {
  switch (action.type) {
    case 'TOGGLE':
      return { isOpen: !state.isOpen };
    default:
      return state;
  }
};

const Header = () => {
  const [state, dispatch] = useReducer(navReducer, { isOpen: true });

  return (
    <Navbar expand='lg'>
      <Container>
        <Navbar.Brand href='#'>Cozy House
        <h6>Shelter for pets in Boston</h6>
        </Navbar.Brand>
        <Hamburger toggled={state.isOpen} toggle={() => dispatch({ type: 'TOGGLE' })} />
        <Navbar.Toggle aria-controls='basic-navbar-nav' onClick={() => dispatch({ type: 'TOGGLE' })} />
        <Navbar.Collapse className={state.isOpen ? 'show' : ''} id='basic-navbar-nav' style={{ flexGrow: '0' }}>
          <Nav>
            <Nav.Link href='#'>About the shelter</Nav.Link>
            <Nav.Link href='#'>Our pets</Nav.Link>
            <Nav.Link href='#'>Help the shelter</Nav.Link>
            <Nav.Link href='#'>Contacts</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default Header;
